create table customers (
	id INT NOT NULL,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	status VARCHAR(50),
	cnic VARCHAR(50),
	country VARCHAR(50),
	city VARCHAR(50),
	tags VARCHAR(50),
	dob DATE,
    createdAt timestamp with time zone DEFAULT CURRENT_TIMESTAMP,
    updatedAt timestamp with time zone DEFAULT CURRENT_TIMESTAMP
);

create table accounts (
	id INT NOT NULL,
	account_title VARCHAR(200),
	opening_date DATE,
	transaction_limit INT,
	currency VARCHAR(50),
	status VARCHAR(9),
	account_type VARCHAR(11),
    customer_id INT DEFAULT 0 NOT NULL,
    createdAt timestamp with time zone DEFAULT CURRENT_TIMESTAMP,
    updatedAt timestamp with time zone DEFAULT CURRENT_TIMESTAMP
);

create table transactions (
	id INT NOT NULL,
    source_account_id INT DEFAULT 0 NOT NULL,
    target_account_id INT DEFAULT 0 NOT NULL,
	initiation_date DATE NOT NULL,
	completion_date DATE NOT NULL,
	location VARCHAR(50) NOT NULL,
	channel VARCHAR(13),
	medium VARCHAR(10),
	amount INT,
	tag VARCHAR(11),
	status VARCHAR(9),
	currency VARCHAR(50),
	device VARCHAR(7),
    createdAt timestamp with time zone DEFAULT CURRENT_TIMESTAMP,
    updatedAt timestamp with time zone DEFAULT CURRENT_TIMESTAMP
);


















